import React from 'react'
import { Link } from 'react-router-dom'

export default function About() {
  return (
    <>
      <div className='crumb'>
        <Link to="/Home">Home</Link>&nbsp;&nbsp; / &nbsp;&nbsp;<strong>About</strong>
      </div>
    </>
  )
}
